import React from 'react';
import betaImage from '../images/beta-preview.png'
import mwwImage from '../images/mww-preview.png'
import lightImage from '../images/light-wallet-preview.png'

const Home = () => {
  return(
    <div class="home">
      <p class="info">Welcome to Wanchain.guide</p>
      <p class="info">This website shows you the different wallets and how to use them</p>
      <img class="image-link beta-" src={betaImage} alt="Beta Wallet Instructions Video"/>
      <img class="image-link" src={mwwImage} alt="MyWanWallet.io Instructions Video"/>
      <img class="image-link" src={lightImage} alt="Light Wallet Instructions Video"/>
    </div>
  )
}

export default Home
